import logo from './logo.svg';
import React from 'react';
import './App.css';


const App = () => {
  return (
    <div className="App">
      <header>
        <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR7WLLQxT7M-194dgg1Wid3Fw_LCV1SfHv1ug&usqp=CAU"></img>

      </header>
      <nav>
        <ul>
          <li>Profile</li>
          <li>Messages</li>
          <li>Main content</li>
        </ul>
      </nav>

    </div>
  );
}

export default App;
